import React,{Component} from "react"

export default class FormNavBar extends Component{

    constructor(props) {
        super(props);
        this.state = {
            runID:0
        };

    }


    render(){

        return(<form className="navbar-form navbar-left" action="/action_page.php">
        <div className="input-group">
          <input type="text" className="form-control" placeholder="Simulation id" name="search" />
          <div className="input-group-btn">
            <button className="btn btn-light" type="submit">Search</button>
          </div>
        </div>
      </form>)
    }
}
